import React, { Component } from "react";
import TeamMember from "./teammember";





class team extends Component{   
   constructor() {
      super()
      this.state = {info}
    }
   render() {
 const info =                           
      [
      {
         id: '1',
         img: 'https://picsum.photos/70',
         name: "Saoud",
         phone: "090881346",
         email: "ee@ss.com"
      },
      {
         id: '3',
         img: 'https://picsum.photos/71',
         name: "Mohmad",
         phone: "090881346",
         email: "ee@ss.com"
      },

      {
         id: '5',
         img: 'https://picsum.photos/73',
         name: "samer",
         phone: "090881346",
         email: " "
      },
      {
         id: '2',
         img: 'https://picsum.photos/74',
         name: "mazen",
         phone: "090881346",
         email: " "
      },
   ]

const members = info.map(function (member) {
   return (

      <TeamMember
      id = {member.id}
      img ={member.img}
      name={member.name}  
      email={member.email}
      phone={member.phone} />) 
})

   return (
      <div className="row container ">
      {members}
   </div>
)
}

  
}


export default team
